    false,nt"url": null,nt"notes": "Data are currently limited or lacking for
    several federally managed rockfish species of the genus Sebastes found within the
    Gulf of Alaska. This project is related to the core mission of the Alaska Fisheries
    Science Center as it will provide data which will refine and improve assessment
    models for these commercially important species. The initial data collection from
    this project began in 2009 and is on-going. Samples of a variety of rockfish species
    have been collected from several years and in several locations throughout the Gulf
    of Alaska. These data are stored in database files (MS Excel or MS Access).",nt"owner_org":
